//augmented Bollinger Bands
let candle = record.current
let P = 5 // number of periods for EMAs

variable.highs.push(candle.max)
variable.lows.push(candle.min)

if(variable.highs.length > P){
	variable.highs.splice(0,1)
}
if(variable.lows.length > P){
	variable.lows.splice(0,1)
}

if(variable.previousEMAHigh === undefined){
	variable.previousEMAHigh = candle.max
}
if(variable.previousEMALow === undefined){
	variable.previousEMALow = candle.min
}

variable.emaH = calculateEMA(P, candle.max, variable.previousEMAHigh)
variable.emaL = calculateEMA(P, candle.min, variable.previousEMALow)

variable.previousEMALow = variable.emaL
variable.previousEMAHigh = variable.emaH

variable.H = 0
variable.L = 0
if(variable.highs.length === P){
	for(var i = 0 ; i < P ; i++){
		variable.H += Math.pow(variable.highs[i] - variable.emaH,2)
		variable.L += Math.pow(variable.lows[i] - variable.emaL,2)
	}
	variable.sH = Math.sqrt(variable.H / P)
	variable.sL = Math.sqrt(variable.L / P)
}else{
	variable.sH = 0.01 * variable.emaH
	variable.sL = 0.01 * variable.emaL
}

variable.middle = (variable.emaH + variable.emaL) / 2
variable.upper = 2 * variable.sH + variable.middle
variable.lower = variable.middle - 2 * variable.sL


//EMA calculation function
	function calculateEMA(periods, price, previousEMA) {
		let k = 2 / (periods + 1)
		return price * k + previousEMA * (1-k)
    }

//Stochastic 
let candle = record.current
let P = 5 //number of periods to analyse stochastic oscillator

variable.high.push(candle.max)
variable.low.push(candle.min)
variable.lastClose.push(candle.close)

if(variable.lastClose.length > P){
    variable.high.splice(0,1)
    variable.low.splice(0,1)
    variable.lastClose.splice(0,1)
}

if(variable.lastClose.length === P){
    variable.hHigh = Math.max.apply(Math, variable.high)
    variable.lLow = Math.min.apply(Math, variable.low)
    variable.K = (candle.close - variable.lLow) / (variable.hHigh - variable.lLow) * 100
}else{
    variable.K = 50
}

//ATR
let candle = record.current
let P = 5 //periods for ATR

if(variable.prevClose === undefined){
	variable.prevClose = candle.close
}

variable.TR.push(Math.max((candle.max - candle.min), Math.abs(candle.max - variable.prevClose), Math.abs(candle.min - variable.prevClose)))
if(variable.TR.length > P){
	variable.TR.splice(0,1)
}

variable.sTR = 0
if(variable.TR.length === P){
	for(var i = 0; i < P; i++){
		variable.sTR += variable.TR[i]
	}
	variable.ATR = variable.sTR / P
}else{
	variable.ATR = candle.max - candle.min
}

variable.prevClose = candle.close

